#include "common.h"
class CustomStack {
public:
    CustomStack(int maxSize) {
		capacity = maxSize;

    }

    void push(int x) {
        if ((int)s.size() < capacity) {
			s.push(x);
        }
    }

    int pop() {
		if (s.empty()) {
			return -1;
		}
		else {
			int v1 = s.top();
			int n = s.size();
			// need to check increments
			if (interval.empty()) {
				s.pop();
				return v1;
            } else {
                if (-interval.begin()->first < n - 1) {
                    s.pop();
					return v1;
                } else {
                    //while (!interval.empty() && -interval.begin()->first == n - 1) {
                    if (!interval.empty() && -interval.begin()->first == n - 1) {
                        v1 += interval.begin()->second;
                        auto tmp = *interval.begin();
						interval.erase(interval.begin());
                        tmp.first++;
                        //while (!interval.empty() && tmp.first == interval.begin()->first) {
                        if (!interval.empty() && tmp.first == interval.begin()->first) {
                            tmp.second += interval.begin()->second;
                            interval.erase(interval.begin());
                        }
                        interval.insert(tmp);
                    }
                    s.pop();	
					if (s.empty()) {
						interval.clear();
					}
					return v1;
                }
            }
        }

    }

    void increment(int k, int val) {
		if (val > 0) {
            k = min(k, (int)s.size());
			k--;
			if (k >= 0) {
                //interval.insert({ -k, val });
				auto it = interval.lower_bound({-k, INT_MIN});
				if (it == interval.end() || it->first != -k) {
					interval.insert({-k, val});
				} else {
					auto tmp = *it;
					interval.erase(it);
					tmp.second += val;
					interval.insert(tmp);
				}
            }

        }
    }
private:
	stack<int> s;
	int capacity;
	//multiset<pair<int, int>> interval;
	set<pair<int, int>> interval;
};


